主要围绕 @htwx 的CTS (基于TS 3.3) 的开发进行讨论. 编译器部分已基本完成. 个人建议尽量控制项目范围(现已非常庞大), 在基本功能完成之前, 避免引入额外的工作量. 比如性能优化, 术语词典更新后为用户代码进行自动升级, 甚至TS与CTS的互转功能, 都可在初版发布后再进行. 项目网站与演示功能也许可以借助组内力量.

@cflw qq@fool 一同讨论.

@nobodxbodon 上周改进一些[vscode翻译插件](https://marketplace.visualstudio.com/items?itemName=CodeInChinese.EnglishChineseDictionary)
